The Hindu holy cities of Haridwar and Rishikesh along with the Himalayan pilgrimage circuit of Chota Char Dham i.e. Yamunotri, Gangotri, Kedarnath and Badrinath. Tourist destinations include the Dehradun Zoo, Kalanga Monument, Chandrabani, Himalayan Gallary cum Regional Science Centre Guchhupani, Forest Research Institute, Tapovan, Lakshman Siddha Peeth, Tapkeshwar Temple, Santala Devi Temple, Mindrolling Monastery etc.
